import React, { useState } from 'react';
import { BrowserRouter as Router, Route , Routes} from "react-router-dom";
import { Link } from "react-router-dom";

import Page1 from './page1'; 
import Page2 from './page2';
import Page3 from './page3';

import "../style/projectselector.css";


function PageSelector() {

  return (
	  <body>
		  <div id="container">
			  <a className="animated zoomInLeft button blue" href="/">Damage A</a>
			  <a className="animated zoomInRight button green" href="/">Damage B</a>
			  <a className="animated zoomInLeft button yellow" href="/">Damage C</a>
			<ul>
				<li><Link to="/">Home</Link></li>
				<li><Link to="/page1/">Page 1</Link></li>
				<li><Link to="/page2/">Page 2</Link></li>
				<li><Link to="/page3/">Page 3</Link></li>
			</ul>
		</div>
	  </body>
	
  );
}

export default PageSelector;
